        <div class="vacancy-branded-user-content" itemprop="description" data-qa="vacancy-description">
         <p>An international software development company invites candidates for the position of Project Director (senior person with at least +10 years of experience who can fluently influence the client's senior stakeholders)</p> 
         <p><strong>Requirements:</strong></p> 
         <ul> 
          <li>10+ years of experience from Senior Project Manager/Program Manager role</li> 
          <li><strong>Proven track record of running software implementation projects with clients (retail, banks, etc)</strong></li> 
          <li>Earlier experience from Senior Project Manager/Program Manager role in implementations with multi-year project &amp; multiple parallel work streams with tens of people working on each stream</li> 
          <li>Should be able to demonstrate a track record of successful implementations and which KPIs were achieved in each project</li> 
          <li>Earlier experience from strategic planning and building long term plans to demonstrate business value</li> 
          <li><strong>Advanced capability to build and maintain C-level relationships</strong></li> 
          <li>Excellent communication &amp; negotiation skills (English + Russian)</li> 
          <li>Preferably earlier experience from e.g. ERP implementations (SAP/Oracle) or from the implementation of a business critical system.</li> 
         </ul> 
         <p><strong>Job description:</strong></p> 
         <ul> 
          <li>High Level role. This person's responsibility is to build relationships with decision makers on the client's side. Be able to understand what the key drivers are which the client is looking for to achieve in this project.</li> 
          <li>Responsibility to manage the conversation with the C-level people to make sure the project is going in the right direction and all client requirements and needs are met.</li> 
          <li>Responsibility to communicate customer’s needs and concerns also to the project team and make sure all that company have promised will be delivered on time.</li> 
          <li>Responsibility to handle all the escalations (for example, in the event we are not able to offer the solutions to a specific need/process the client has identified).</li> 
          <li>Will create and manage powerpoint presentations to C-level people</li> 
          <li>It is critical that this person is able to create and nurture a relationship of trust with the client through his/her own expertise and by managing efficiently the big picture.</li> 
          <li>This person will be responsible for the project schedules and making sure that we are keeping the schedule we have promised/</li> 
         </ul> 
         <p>Terms and conditions:</p> 
         <ul> 
          <li>Interesting and dynamic work in international team</li> 
          <li>Remote work from any region of Russia with the need to travel on business trips for about 50 % of the working time.</li> 
          <li>Permanent contract</li> 
         </ul>
